import getData from '@/pages/trade/navbar/components/data.json';
import HoSoUserInfo from '@/pages/trade/slidebar/HoSoUser';
import I18n from "./i18n"; // import HisOrderBet from '@/pages/trade/slidebar/HisOrderBet.vue';

export default {
  components: {
    I18n: I18n,
    HoSoUserInfo: HoSoUserInfo // HisOrderBet

  },
  data: function data() {
    return {
      blObj: getData,
      switchAmThanh: true,
      popupActiveCaiDat: false,
      addSidebarHisOrder: false,
      // Data Sidebar
      addNewDataSidebar: false,
      sidebarData: {}
    };
  },
  methods: {
    logOut: function logOut() {
      localStorage.removeItem('tokenUser');
      localStorage.removeItem('INFO'); // xÃ³a notice = 0

      getData.Notify = 0;
      localStorage.removeItem('stateOpen'); // This is just for demo Purpose. If user clicks on logout -> redirect
      //this.$router.push('/login').catch(() => {})   

      window.location.href = window.location.origin + '/login';
    },
    viewHoSo: function viewHoSo() {
      this.toggleDataSidebar(true);
    },
    toggleDataSidebar: function toggleDataSidebar() {
      var val = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : false;
      this.addNewDataSidebar = val;
    },
    OnOffSound: function OnOffSound() {
      if (this.switchAmThanh) {
        localStorage.setItem('SOUND', true);
      } else {
        localStorage.setItem('SOUND', false);
      }
    },
    viewHisOrder: function viewHisOrder() {
      this.toggleDataSidebarHisOrder(true);
    },
    toggleDataSidebarHisOrder: function toggleDataSidebarHisOrder() {
      var val = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : false;
      this.addSidebarHisOrder = val;
    }
  }
};
